import React from 'react';
import Slider from "react-slick";
import { Link  } from 'react-router-dom';

const Sanphamnoibat = () => {
    const settings =  {
      arrowsScroll: 2,
      autoplay: true,
      initialSlide: true,
      rows: 2,
      slidesToShow: 5,
      swipe: false,

    };
    const slidesData = [
    {
        id: 1,
        img: '../../img/22490-fold.webp',

    },
    {
        id: 2,
        img: '../../img/airpod2-259.webp',

    },
    {
        id: 3,
        img: '../../img/RightBanner_690x300_ASUS-VIVOBOOK.webp',
    }
];
  return (
    <div>
        <span>CustomSlider</span>
        <Slider { ...settings }>
        <Link className=''>
                {/* <img className='right-banner__img' /> */}
                {slidesData.map((slide) =>
            <div >
              <img className='' src={slide.img} alt=''/>
            </div>
          )}
            </Link>
        </Slider>
      </div>
  )
}

export default Sanphamnoibat
